(1, 1, 'Business', 'مقدمي الخدمة', '<ul class=\"list-inline list-gutter\">\r\n<li>موقع انترنت احترافي</li>\r\n<li>تقارير تشمل الحجوزات والعملاء واكثر</li>\r\n<li>حجوزات اونلاين</li>\r\n<li>الدفع عن طريق البطاقات الائتمانية</li>\r\n<li>قائمة بالخدمات الخاصة بك</li>\r\n<li>الاطلاع على تقييم العملاء وتعليقاتهم</li>\r\n<li>العروض الخاصة للعملاء</li>\r\n<li>متابعة المبيعات وكيفية نموها</li>\r\n<li>جداول زمنية ... اوقات العمل ... وادارة الوقت</li>\r\n<li>الاطلاع على تقارير الدخل اليومي</li>\r\n</ul>', '<ul class=\"list-inline list-gutter\">\r\n<li>موقع انترنت احترافي</li>\r\n<li>تقارير تشمل الحجوزات والعملاء واكثر</li>\r\n<li>حجوزات اونلاين</li>\r\n<li>الدفع عن طريق البطاقات الائتمانية</li>\r\n<li>قائمة بالخدمات الخاصة بك</li>\r\n<li>الاطلاع على تقييم العملاء وتعليقاتهم</li>\r\n<li>العروض الخاصة للعملاء</li>\r\n<li>متابعة المبيعات وكيفية نموها</li>\r\n<li>جداول زمنية ... اوقات العمل ... وادارة الوقت</li>\r\n<li>الاطلاع على تقارير الدخل اليومي</li>\r\n</ul>', 'pages/November2018/5QTCSrLbMgYkdh855vBj.png', 'business', 'هل انت كوافيرة محترفة؟', 'إجعل ادارة اعمالك الكترونية وسلسة ... اضف خاصية الدفع بمختلف الطرق الشائعة ... اكسب زبائن اكثر بإستخدامك لماسك', 'هل انت كوافيرة محترفة؟', 'إجعل ادارة اعمالك الكترونية وسلسة ... اضف خاصية الدفع بمختلف الطرق الشائعة ... اكسب زبائن اكثر بإستخدامك لماسك', NULL, NULL, NULL, NULL, 'Business', 'Business , signup', 'ACTIVE', '2018-10-04 04:29:50', '2019-01-15 13:10:49'),
(2, 1, 'Team', 'ٹیم', '<div class=\"container\">\r\n<section class=\"spinz-section\">\r\n<p><span style=\"color: #ffffff;\"><strong>Our professional team is dedicated to provide the best services in order&nbsp;give you the experience that you deserve and more ...</strong></span></p>\r\n<p><span style=\"color: #ffffff;\"><strong>Mask include a lot of pioneer centres in:</strong></span></p>\r\n<p><span style=\"color: #ffffff;\"><strong>Beauty</strong></span></p>\r\n<p><span style=\"color: #ffffff;\"><strong>Salons</strong></span></p>\r\n<p><span style=\"color: #ffffff;\"><strong>SPA &amp; relaxation</strong></span></p>\r\n<p><span style=\"color: #ffffff;\"><strong>Professional Makeup artist</strong></span></p>\r\n<p><span style=\"color: #ffffff;\"><strong>Mask will provide fast service and convenient one, as well as the ability to compare; thus, you will manage your time effectively and save your efforts.&nbsp;</strong></span></p>\r\n<p><span style=\"color: #ffffff;\"><strong>Know you can make your online reservation in Riyadh without phone call, it&rsquo;s so easy.</strong></span></p>\r\n</section>\r\n</div>', '<div class=\"container\">\r\n<section class=\"spinz-section\">\r\n<p><span style=\"color: #ffffff;\"><strong>Our professional team is dedicated to provide the best services in order&nbsp;give you the experience that you deserve and more ...</strong></span></p>\r\n<p><span style=\"color: #ffffff;\"><strong>Mask include a lot of pioneer centres in:</strong></span></p>\r\n<p><span style=\"color: #ffffff;\"><strong>Beauty</strong></span></p>\r\n<p><span style=\"color: #ffffff;\"><strong>Salons</strong></span></p>\r\n<p><span style=\"color: #ffffff;\"><strong>SPA &amp; relaxation</strong></span></p>\r\n<p><span style=\"color: #ffffff;\"><strong>Professional Makeup artist</strong></span></p>\r\n<p><span style=\"color: #ffffff;\"><strong>Mask will provide fast service and convenient one, as well as the ability to compare; thus, you will manage your time effectively and save your efforts.&nbsp;</strong></span></p>\r\n<p><span style=\"color: #ffffff;\"><strong>Know you can make your online reservation in Riyadh without phone call, it&rsquo;s so easy.</strong></span></p>\r\n</section>\r\n</div>', 'pages/November2018/gK2slVAw1NaKi2NSHxq6.jpg', 'team', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'team', 'team', 'ACTIVE', '2018-11-21 10:05:16', '2019-01-15 12:56:09'),
(3, 1, 'Career', 'The Best Beauty Services', '<div class=\"container\">\r\n<section class=\"spinz-section\">\r\n<h1><span style=\"color: #ffffff;\">We are welcoming all qualified persons welling to work with us.</span></h1>\r\n<h1><span style=\"color: #ffffff;\">Please send your CV to:</span></h1>\r\n<h1><span style=\"color: #ffffff;\">careers@mask-app.com</span></h1>\r\n</section>\r\n</div>', NULL, 'pages/November2018/ZwhFtwC2kKvNvE3Cioy7.jpg', 'career', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'career', 'career', 'ACTIVE', '2018-11-21 10:23:25', '2018-11-21 10:23:25'),
