(12, 'admin.jewelries', '[:en]Jewellery[:ar]مجوهرات[:]', '<p>[:en]How to get Jewelries Jewelries can be easily earned. As a registered user of MASK you can earn Jewelries when you make a booking, add a comment, etc.</p>\r\n<ul>\r\n<li>when you book a service or add a comment, you will get 5 Jewelries.</li>\r\n<li>For each 200 SAR you spend with MASK you will get 10 Jewelries.</li>\r\n</ul>\r\n<p>Redeeming Jewelries Jewelries can be redeemed and added to your invoice at the time of payment to get discounts and free services with MASK.</p>\r\n<ul>\r\n<li>For every 375 jewelries you will get services for 75 SAR from any service provider registered with MASK.</li>\r\n</ul>\r\n<p>Note: Jewelries will be deducted when booking gets canceled or service is not completed.[:ar]</p>\r\n<p style=\"text-align: right;\">طريقة الحصول على الجواهر</p>\r\n<p style=\"text-align: right;\">الجواهر يتم جمعها بكل سهولة. كونك احد عملاء ماسك يمكنك كسب الجواهر لكل عملية حجز وكذلك عند اضافة تعليق وغيرها من الخدمات.</p>\r\n<p style=\"text-align: right;\">عند الحجز تحصلين على ٥ جواهر. عند اضافة تعليق تحصلين على خمس جواهر. كل ٢٠٠ ريال في فاتورتك يعطيك ١٠ جواهر.</p>\r\n<p style=\"text-align: right;\">&nbsp;</p>\r\n<p style=\"text-align: right;\">استبدال الجواهر</p>\r\n<p style=\"text-align: right;\">يمكنك استبدال الجواهر واضافتها على فاتورتك عند الدفع لتستمتعي بخصومات وخدمات مجانية مع ماسك.</p>\r\n<p style=\"text-align: right;\">&bull; يمكنك استبدال ٣٧٥ من الجواهر كحد ادنى للحصول على خدمات بقيمة ٧٥ ريال سعوديمن اي خدمة تختارها من خدمات مقدمي الخدمة لدى ماسك.</p>\r\n<p style=\"text-align: right;\">ملاحظة:</p>\r\n<p style=\"text-align: right;\">يتم حسم الجواهر المضافة عند الغاء الحجز او عند عدم اكمال الخدمة</p>\r\n<p>[:]</p>', NULL, 'rich_text_box', 7, 'Admin'),
(13, 'admin.terms-conditions', '[:en]Terms &amp; Conditions[:ar]الشروط والاحكام[:]', '<h3 class=\"panel-title\" style=\"box-sizing: border-box; outline: 0px; font-family: \'Open Sans\', sans-serif; font-weight: 500; line-height: 1.1; color: #37474f; margin-top: 0px; margin-bottom: 0px; font-size: 18px; text-shadow: rgba(0, 0, 0, 0.15) 0px 0px 1px; padding: 20px 0px;\">[:en]<strong>Disclaimer</strong> MASK is a website and mobile application covers all that is specialized in the world of beauty and health which is fully owned by Union East Company Limited. The website, mobile application and all the contents of the software of Mask are available for use under the full responsibility of the user. Your use of the Website and the Application means that you are aware that the information contained in the website, the application was added by third parties and not necessarily by East Union Limited. &nbsp; <strong>Use your website and apply a mask</strong> 1- Your use of the services of East Union Company Limited, the website and the application is subject to all applicable laws and regulations in the Kingdom of Saudi Arabia.</h3>\r\n<ol start=\"2\">\r\n<li>Do not use the Services for commercial purposes and your use for commercial purposes allows us to cancel all services performed for commercial purposes without warning.</li>\r\n</ol>\r\n<p>3 &ndash; You agree that not to offend others in any form, whether personal or programmatic. 4- You agree that not to upload and use the content of the website, the application or any means of the Eastern Union Company Limited in any form except with the written consent of the company management. &nbsp; <strong>Our responsibility</strong> When there is damage while using the application as a result of or because of part of the application, our responsibility is limited to monetary compensation only for transactions performed on the application. East Union Limited is not responsible for any damages or losses in any way as a result of your access to the website, the application, your access to any other website, application through mask-app.com, Mask application, exposure to any form of electronic anti-piracy or any kind of viruses or loss of information. &nbsp; <strong>Reservations and prices</strong> MASK Website and Application is a tool to coordinate between service providers and customers. &nbsp;The prices in the application are added by service providers. Your booking for appointments does not necessarily mean approval of the appointment and the service provider or application management may ask you for additional information to complete or cancel the reservation. Beauty salons reservations (women\'s Salons), fashion designers and make-up artists service provided to women only and the management of the website and the application has the right to cancel or write off any registered account for booking specified to women only among the former service providers and take the necessary legal action to protect the rights. &nbsp; <strong>Rights</strong> East Union company Limited owns all intellectual property rights in the website and application, including database, trademark, all contents and tools of the website and application. &nbsp; <strong>Information security and privacy</strong> East Union Company Limited has taken and takes all measures and regulations to ensure that customer information is not exposed to theft or piracy. However, we do not guarantee that information is not compromised, and we do not take full responsibility unless there is a clear error on our part. &nbsp; <strong>East Union Company might use private personal information in the following cases:</strong> 1- The financial conditions related to cash transactions such as payment and balance to verify payment and others.</p>\r\n<ol start=\"2\">\r\n<li>For the purposes of statistical operations, customer relations and delivery of services to you, including marketing and promotional messages.</li>\r\n</ol>\r\n<p><strong>We may disclose your personal information in the following cases:</strong></p>\r\n<ol>\r\n<li>If we are asked to do so in accordance with applicable laws and regulations or based on a judicial order or similar to a governmental and executive, including the Ministry of the Interior or one of the concerned governmental authorities.</li>\r\n<li>In the case of necessity and at the discretion of the management of Union East Company Limited in respect to the protection of legal and intellectual rights and private property of registered members or third parties or to prevent personal affect.</li>\r\n<li>You are responsible for maintaining the confidentiality of your password, user name, etc.</li>\r\n</ol>\r\n<p>&nbsp; <strong>Cookies</strong> Cookies are small pieces of text information stored by your browser on your computer\'s hard drive. We use cookies to allow us to understand who sees pages and ads, to determine how often private pages are visited, to determine the most popular areas of the site and generally to monitor site usage. Most web browsers accept cookies automatically, and membership requirements can do so. We do not control the use of cookies by third parties. If you want to disable cookies, you can do so by resetting your browser settings. However, please note that by disabling cookies you may not be able to register or use all features of the site. &nbsp; <strong>Service fees</strong> East Union Company Limited has the right to charge fees for use, service or both, and you will be notified, and the user has the right to continue using the service or not. &nbsp; <strong>Update terms and conditions</strong> East Union Company Limited has the right to change the terms and conditions at any time as required by the public interest and you will be informed by means of the electronic communication data of our registered customers.[:ar]</p>\r\n<p style=\"text-align: right;\"><strong>إخلاء مسؤولية</strong></p>\r\n<p style=\"text-align: right;\"><strong>ماسك هو موقع الكتروني وتطبيق للجوال يعني بكل ما هو مختص في عالم الجمال والصحة مملوك بشكل تام لشركة اتحاد الشرق المحدودة.</strong></p>\r\n<p style=\"text-align: right;\"><strong>الموقع الإلكتروني وتطبيق الجوال وجميع محتويات البرمجيات التابعة لماسك متاحه للاستخدام تحت مسؤولية المستخدم بشكل كامل.</strong></p>\r\n<p style=\"text-align: right;\"><strong>استخدامك للموقع الالكتروني والتطبيق يعني إنك على علم بأن المعلومات الواردة في الموقع والتطبيق لا تعني ان شركة اتحاد الشرق المحدودة قد ادلت بها وانما قد تكون تمت اضافتها من أطراف أخرى.</strong></p>\r\n<p style=\"text-align: right;\"><strong>استخدامك للموقع الالكتروني وتطبيق ماسك</strong></p>\r\n<ul style=\"text-align: right;\">\r\n<li><strong>استخدامك لخدمات شركة اتحاد الشرق المحدودة وموقع وتطبيق ماسك خاضع لكافة القوانين واللوائح المعمول بها في المملكة العربية السعودية.</strong></li>\r\n</ul>\r\n<ul style=\"text-align: right;\">\r\n<li>عدم استخدام الخدمات لأغراض تجارية وان استخدامك لأغراض تجاريه يخولنا الغاء كافة الخدمات التي تمت لأغراض تجارية دون سابق انذار.</li>\r\n</ul>\r\n<ul style=\"text-align: right;\">\r\n<li>عدم الإساءة للأخرين بأي شكل من الاشكال سواء على الصعيد الشخصي او البرمجي.</li>\r\n</ul>\r\n<ul style=\"text-align: right;\">\r\n<li>عدم تحميل واستخدام المحتوى الخاص بالموقع الالكتروني او التطبيق او من أي وسيلة خاصة بشركة اتحاد الشرق المحدودة بأي شكل من الاشكال الا بموافقة كتابية من إدارة الشركة.</li>\r\n</ul>\r\n<p style=\"text-align: right;\"><strong>مسؤوليتنا</strong></p>\r\n<p style=\"text-align: right;\"><strong>عند وجود اضرار اثناء استخدامك للتطبيق كنتيجة او بسبب جزء من أجزاء التطبيق فإن مسؤوليتنا تنحصر في التعويض النقدي فقط للعمليات التي تمت على التطبيق.</strong></p>\r\n<p style=\"text-align: right;\"><strong>شركة اتحاد الشرق المحدودة غير مسؤولة عن أي اضرار او خسائر بأي شكل من الأشكال نتيجة دخولك للموقع او التطبيق الالكتروني او وصولك لأي موقع او تطبيق اخر عن طريق موقع او تطبيق ماسك او تعرضك لأي شكل من اشكال القرصنة الالكترونية او أي نوع من الفايروسات او فقدان المعلومات.</strong></p>\r\n<p style=\"text-align: right;\"><strong>الحجوزات واسعارها</strong></p>\r\n<p style=\"text-align: right;\"><strong>الموقع الالكتروني وتطبيق ماسك هو أداة تنسيق بين مقدمي الخدمة والعملاء. الأسعار الموجودة في التطبيق يتم اضافتها عن طريق مقدمي الخدمة. حجزك للمواعيد لا يعني بالضرورة الموافقة على الموعد وقد يطلب مقدم الخدمة او إدارة التطبيق منك معلومات اضافيه لإتمام الحجز او الغائه.</strong></p>\r\n<p style=\"text-align: right;\"><strong>حجوزات صالونات التجميل (المشاغل النسائية) &nbsp;ومصممي الأزياء والكوافيرات المحترفين خدمة مقدمة للسيدات فقط ولإدارة الموقع الحق في الغاء او شطب أي حساب مسجل لغير السيدات يقوم بالحجوزات لمقدمي الخدمات السابق ذكرهم واتخاذ الإجراءات القانونية اللازمة وذلك لحفظ الحقوق.</strong></p>\r\n<p style=\"text-align: right;\"><strong>الحقوق</strong></p>\r\n<p style=\"text-align: right;\"><strong>شركة اتحاد الشرق المحدودة تمتلك كافة حقوق الملكية الفكرية في الموقع الالكتروني والتطبيق بما في ذلك قاعدة البيانات والعلامة التجارية وكل محتويات وادوات الموقع الالكتروني والتطبيق.</strong></p>\r\n<p style=\"text-align: right;\"><strong>امن المعلومات وخصوصيتها</strong></p>\r\n<p style=\"text-align: right;\"><strong>شركة اتحاد الشرق المحدودة اتخذت وتتخذ كافة الإجراءات والأنظمة لضمان عدم تعرض المعلومات الخاصة بالعملاء للسرقة او القرصنة ومع ذلك لا نضمن عدم تعرض المعلومات للقرصنة ولا نتحمل المسؤولية الكاملة الا في حالة وجود خطأ واضح من جانبنا.</strong></p>\r\n<p style=\"text-align: right;\"><strong>شركة اتحاد الشرق من الممكن ان تستخدم المعلومات الشخصية الخاصة في الحالات ادناه:</strong></p>\r\n<ul style=\"text-align: right;\">\r\n<li><strong>الحالات المالية التي تخص العمليات النقدية كالدفع والرصيد للتحقق من الدفع وغيرها.</strong></li>\r\n</ul>\r\n<ul style=\"text-align: right;\">\r\n<li>لأغراض العمليات الإحصائية وعلاقات العملاء ولإيصال الخدمات لك بما فيها الرسائل التسويقية والترويجية.</li>\r\n</ul>\r\n<p style=\"text-align: right;\"><strong>قد نكشف عن معلوماتك الشخصية في الحالات التالية ادناه:</strong></p>\r\n<ul style=\"text-align: right;\">\r\n<li><strong>إذا طلب منا ذلك استناداً إلى القوانين والأنظمة السارية أو استناداً إلى أمر قضائي أو ما شبه ذلك إلى جهة حكومية وتنفيذية، بما في ذلك وزارة الداخلية أو أحد الجهات الحكومية المعنية.</strong></li>\r\n</ul>\r\n<ul style=\"text-align: right;\">\r\n<li>في الحالات الضرورية وبحسب تقدير إدارة شركة اتحاد الشرق المحدودة فيما يخص حماية الحقوق القانونية والفكرية والاملاك الخاصة للأعضاء المسجلين او للأطراف الأخرى او لمنع الاضرار الشخصية.</li>\r\n</ul>\r\n<ul style=\"text-align: right;\">\r\n<li>أنت مسؤول عن الحفاظ على سرية كلمة المرور واسم المستخدم الخاص بك وتكون مسؤولة عن جميع الأنشطة التي تحدث تحتها. أي خسارة أو أي استخدام من هذا القبيل سوف تعتبر مسئوليتك وستكون مسؤولاً عن هذا الاستخدام.</li>\r\n</ul>\r\n<p style=\"text-align: right;\"><strong>ملفات تعريف الارتباط (الكوكيز)</strong></p>\r\n<p style=\"text-align: right;\"><strong>ملفات تعريف الارتباط عبارة عن أجزاء صغيرة من المعلومات النصية المخزنة بواسطة متصفحك على القرص الصلب للكمبيوتر الخاص بك. نستخدم ملفات تعريف الارتباط للسماح لنا بفهم من شاهد أي الصفحات والإعلانات، لتحديد عدد مرات زيارة الصفحات الخاصة، لتحديد المناطق الأكثر شعبية في الموقع وبشكل عام من أجل مراقبة استخدام الموقع. معظم متصفحات الويب تقبل ملفات تعريف الارتباط تلقائيا، ومتطلبات العضوية هي قادرة على القيام بذلك. نحن لا نتحكم في استخدام ملفات تعريف الارتباط من قبل أطراف ثالثة. إذا كنت ترغب في تعطيل ملفات تعريف الارتباط، فيمكنك القيام بذلك عن طريق إعادة ضبط إعدادات المستعرض الخاص بك على الرغم من ذلك يرجى ملاحظة أنه عن طريق تعطيل ملفات تعريف الارتباط قد لا تتمكن من التسجيل في جميع ميزات الموقع أو استخدامها.</strong></p>\r\n<p style=\"text-align: right;\"><strong>رسوم الخدمات</strong></p>\r\n<p style=\"text-align: right;\"><strong>لشركة اتحاد الشرق المحدودة الحق في فرض رسوم على الاستخدام او الخدمة او كليهما وسيتم ابلاغكم بذلك وللمستخدم الحق في الاستمرار باستخدام الخدمة من عدمها.</strong></p>\r\n<p style=\"text-align: right;\"><strong>تحديث الشروط والأحكام</strong></p>\r\n<p style=\"text-align: right;\"><strong>لشركة اتحاد الشرق المحدودة الحق بتغيير الشروط والأحكام في أي وقت بحسب ما تستدعيه المصلحة العامة وعليه سيتم ابلاغكم بذلك عن طريق بيانات التواصل الالكترونية الخاصة بالعملاء المسجلة لدينا.</strong></p>\r\n<p>&nbsp;[:]</p>', NULL, 'rich_text_box', 8, 'Admin'),
